lsp4e/pull/103', 'diff_url': 'https://github.com/eclipse/lsp4e/pull/103.diff', 'patch_url': 'https://github.com/eclipse/lsp4e/pull/103.patch', 'merged_at': None}, 'body': 'In https://github.com/eclipse/lsp4e/pull/92 we introduced the possibility of initializing server before the user open a file in the editor, as a related functionality, we introduce the possibility of keeping the server running even if the last connected document is disconnected.
The reasoning is similar as in that PR: our language server will setup some state and do an initial build (The initial build in our case just loads the precomputed state and will publish the markers of this state to the user, that is different to the eclipse target) on initialization, and this is time consuming. In addition to start the LS upfront, we also want to keep it running even if editors are closed.', 'reactions': {'url': 'https://api.github.com/repos/eclipse/lsp4e/issues/103/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/eclipse/lsp4e/issues/103/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/eclipse/lsp4e/issues/comments/1099169725', 'html_url': 'https://github.com/eclipse/lsp4e/pull/103#issuecomment-1099169725', 'issue_url': 'https://api.github.com/repos/eclipse/lsp4e/issues/103', 'id': 1099169725, 'node_id': 'IC_kwDOGY2K185Bg_-9', 'user': {'login': 'martinlippert', 'id': 107705, 'node_id': 'MDQ6VXNlcjEwNzcwNQ==', 'avatar_url': 'https://avatars.githubusercontent.com/u/107705?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/martinlippert', 'html_url': 'https://github.com/martinlippert', 'followers_url': 'https://api.github.com/users/martinlippert/followers', 'following_url': 'https://api.github.com/users/martinlippert/following{/other_user}', 'gists_url': 'https://api.github.com/users/martinlippert/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/martinlippert/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/martinlippert/subscriptions', 'organizations_url': 'https://api.github.com/users/martinlippert/orgs', 'repos_url': 'https://api.github.com/users/martinlippert/repos', 'events_url': 'https://api.github.com/users/martinlippert/events{/privacy}', 'received_events_url': 'https://api.github.com/users/martinlippert/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-04-14T13:10:00Z', 'updated_at': '2022-04-14T13:10:00Z', 'author_association': 'CONTRIBUTOR', 'body': '> I have looked at how one would implement it, and I would be happy to rework the commit to support a timeout, so that the use case of @martinlippert would be covered as well. I would rename the config item to lastDocumentDisconnectedTimeout, default it to 0, and handle the case -1 specially (it is strictly not needed and I could do with a very high timeout to disable cloning, but it would create a thread with a timer for no actual usage, having -1 or something else looks nicer to me).

@rubenporras Sounds good to me and feels like it would allow great flexibility for all three use cases (stop immediately, stop later if no document is opened again, never stop) while keeping the existing behavior intact (so no breaking change). But it is less self-explaining (you would need to educate users that a "magic" timeout value of `-1` means to never stop the server.

I would also be happy with less flexibility, so that we define an enum for those three use cases and that's it. That way, LSP4E would probably hard-code the exact timeout for the second use case, but the different use cases would be more self-explaining. Having both sounds a bit too much for me.

What do you think @rubenporras @mickaelistria ?', 'reactions': {'url': 'https://api.github.com/repos/eclipse/lsp4e/issues/comments/1099169725/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

