rtinlippert/following{/other_user}', 'gists_url': 'https://api.github.com/users/martinlippert/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/martinlippert/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/martinlippert/subscriptions', 'organizations_url': 'https://api.github.com/users/martinlippert/orgs', 'repos_url': 'https://api.github.com/users/martinlippert/repos', 'events_url': 'https://api.github.com/users/martinlippert/events{/privacy}', 'received_events_url': 'https://api.github.com/users/martinlippert/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-03-24T09:09:10Z', 'updated_at': '2022-03-24T09:09:10Z', 'author_association': 'MEMBER', 'body': 'Another thought here: If we allow the conversion to change the existing file (rename + content conversion), we would need to make sure that the conversion is exact and nothing gets lost in the conversion. This might be hard to achieve.

As a consequence, we could also always create a new file (in addition to the existing one) and put the converted content in the new file without deleting the existing file. That would prevent the user from loosing something in case the conversion is not fully complete or missed something.

We could also add a preference for this to switch between the modes ("delete file after property conversion") that would be disabled at the beginning and users could enable this if they think the old file should always be deleted.', 'reactions': {'url': 'https://api.github.com/repos/spring-projects/sts4/issues/comments/1077398171/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

