id': 'MDU6TGFiZWwyNzM5MzM5MDE4', 'url': 'https://api.github.com/repos/spring-projects/sts4/labels/type:%20install-issue', 'name': 'type: install-issue', 'color': 'D4C5F9', 'default': False, 'description': ''}], 'state': 'closed', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 2, 'created_at': '2022-03-21T05:16:57Z', 'updated_at': '2022-03-22T12:17:51Z', 'closed_at': '2022-03-22T05:28:38Z', 'author_association': 'NONE', 'active_lock_reason': None, 'body': '**Describe the bug**
It returns an error message "Could not initialize class org.testng.eclipse.util.ClassMethodsSuite" when I try running a simple TestNG class.

**Sample**
Following is my code. There is nothing complicated:

package tutorialPackage;
import org.testng.annotations.Test;
public class TestClass {	
	@Test
	public void demo() {
		System.out.println("Hello");
	}
}

When I run the above code, I get an error message as:
